import Link from 'next/link'

export default function Person({ person }) {

  return (
    <li>
      <Link href="/person/[id]" as={`/person/${person.id}`}>
        <a>{person.name}</a>
        <div>{person.author}</div>
      </Link>
      <img src={person.img} />
    </li>
  )
}
